import styles from "./SignUpForm.module.scss";

function SignUpForm() {
  return (
    <form className={styles.container}>
      <label>Name:</label>
      <input type="text" />
      <label>Email:</label>
      <input type="text" />
      <label>Password:</label>
      <input type="password" />
      <label>PasswordConfirm:</label>
      <input type="password" />
    </form>
  );
}

export default SignUpForm;
